import React,{Component} from 'react'; 
import Afternav from "../Coponent/nav_after";
import Avatar from '../Coponent/uploadAvatar';

class Profile extends Component {
    constructor(){
        super();
        this.state = {
            l:[]
        }
    }
    handleSubmit1= (event) =>{
        const d=this.props.user
        console.log(d)
        this.setState({
            l:d
        })
    }
    
    render() {
        const {l}=this.state
        
        return (
            <div className="room">
                <Afternav />  
                <button className="profile_button" onClick={()=>this.handleSubmit1()}>your profile</button>              
                <div className="containerPro">
                    
                        <div className="colPro1">
                            <Avatar />
                        </div>
                        <div >
                            <ul>
                                <li>
                                    <p>First Name: </p> 
                                    <br></br>
                                    <h3>{l.first_name}</h3>
                                    
                                </li> 
                            
                                <li>
                                    <p>Last Name: </p>
                                    <br></br>
                                    <h3>{l.last_name}</h3>
                                </li>                       
                            
                                <li>
                                    <p>Email: </p>
                                    <br></br>
                                    <h3>{l.email}</h3>
                                </li>                          
                                <li>
                                    <p>Mobile Phone: </p>
                                    <br></br>
                                    <h3>{l.mobile_phone}</h3>
                                </li>         
                                <button className="save_button" onClick={()=>this.handleSubmit1()}>save</button>              
                            </ul>                      
                                
                        </div>
                    </div>
                </div>

        );
    }
}
export default Profile;
